create table if not exists painting
(
    id                      binary(16)  unique not null default (UUID_TO_BIN(UUID(), true)),
    title                   varchar(255)        not null,
    description             text                not null,
    content                 longblob            not null,
    museum_id               binary(16)          not null,
    artist_id               binary(16)          not null,
    primary key (id)
);

insert into painting (title, description, content, museum_id, artist_id) VALUES ('Утро в сосновом лесу','Картина русских живописцев Ивана Шишкина и Константина Савицкого, написанная в 1889 году; одно из наиболее популярных полотен Шишкина[3], хрестоматийный шедевр реалистической школы второй половины XIX века, один из самых известных пейзажей в истории русского искусства. Является частью собраний Третьяковской галереи в Москве (инв. 841), выставляется в 25-м зале в историческом здании галереи на Лаврушинском переулке, 10. Техника исполнения произведения — масляная живопись на холсте, размер полотна — 139 × 219 см.','data:image/jpeg;base64,',(UUID_TO_BIN('11ee80f2-65ab-d453-a8c4-0242ac110002')),(UUID_TO_BIN('11ee80e1-d852-1f68-a8c4-0242ac110002')));

insert into painting (title, description, content, museum_id, artist_id) VALUES ('Две девушки, читающие в саду','На первой картине мы видим двух девушек, читающих в саду.Казалось бы просто чтение, но насколько прекрасна сама композиция! Зритель как будто находится рядом и также очарован чтением. И даже может представить, что в книге написано о чем-то добром и светлом - об этом "говорят" лица девушек и мягкая улыбка у одной из них.Считывающаяся гармония увлеченных чтением усиливается гармонией сада - плавность мы видим и в изображении зелени вокруг.При этом она нисколько не отвлекает - нет ни цветов, ни подробных контуров - всё внимание автор обращает на гармонию читающих.','data:image/webp;base64,',(UUID_TO_BIN('11ee80f2-65c1-2d5d-a8c4-0242ac110002')),(UUID_TO_BIN('11ee80e1-d858-ede7-a8c4-0242ac110002')));